export default [
    {
      id: 'a',
      type: 'input',
      data: { label: 'Node A' },
      position: { x: 250, y: 25 },
    },
  
    {
      id: 'b',
      data: { label: 'Node B' },
      position: { x: 100, y: 125 },
    },
    {
      id: 'c',
      type: 'output',
      data: { label: 'Node C' },
      position: { x: 250, y: 250 },
    },
  ];
